import classes from "./ErrorModal.module.css";
import Card from "./Card";
import Button from "./Button";

const ErrorModal = (props) => {
    return (
        <Card>
            <header className={classes.header}>
                <h2 className={classes.h2}></h2>
            </header>
            <div>
                <p>TEST</p>
            </div>
            <footer>
                <Button>Close</Button>
            </footer>
        </Card>
    );
};

export default ErrorModal;
